        const {adStarted, params = {}} = adEvent;
        const {controls, skipTime, type} = params;
        if (adStarted) {
            scheduleSkipAd(skipTime);

            if (!controls || type == 'vpaid') {
                toggleAdLayout(false);
                return;
            }

            toggleAdLayout(true);

            if (controls === 'imaControls') {
                toggleImaControlsDisplay(false);
